import { useState } from 'react'

const Button = ({ onClick, text }) => {
  <Button onClick={onClick()}>{text}</Button>
}

const Statistics = (props) => {
  <div>
    <h1>statistics</h1>
    <p>good {props.good}</p>
    <p>neutral {props.neutral}</p>
    <p>bad {props.bad}</p>
  </div>
}



export default App
